import Link from "next/link";
import Layout from '../components/Layout';
import {connect} from 'react-redux';
import { Component } from "react";

class index extends Component{
    constructor(props){
        super(props);
        this.setRand = this.setRand.bind(this);
    }

    setRand(){
        var arr = [0,1,2,3,4,5,6,7,8,]

        return this.props.dispatch({ type: 'SETRAND', rand_arr: arr});
    }

    render(){
        return(
            <Layout>
                <div className="main-screen">
                    <div className="text1">このクイズであなたの鬼滅力を試すことができます。</div>
                    <Link href="/Main">
                        <div className="start_btn" onClick={this.setRand}>スタート</div>
                    </Link>
                </div>
            </Layout>
        )
    }
}

index = connect((state)=>state)(index)
export default index;
